GameData["ui_ext"]["ui_info"]["help_text_list"]["text_01"] = [[$16021351]] -- - Elite Heavy Infantry. Healer Leader Unit. Librarium Psyker.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_02"] = [[$16021352]] -- - Very tough advanced combat unit. Slow moving. Advanced equipment upon deployment.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_03"] = [[$16021353]] -- - Member of the Apothecarion of the Ordo Malleus, with advanced healing powers.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_04"] = [[$16021354]] -- - Carries a warding staff the cripples enemy psykers and finishes off wounded troops.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_05"] = [[$16021355]] -- - Equipped with a mastercraft psilencer, a psionic weapon of unfailing accuracy against infantry.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_06"] = [[$16021356]] -- - Can use his teleporters to access remote or unreachable locales on the map.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_07"] = [[$16021357]] -- - Greatly enhances the regeneration rate of the squad he leads; Also heals poison conditions.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_08"] = [[$16021358]] -- - His Healing Touch ability cures even critical wounds suffered, to any nearby army squad.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_09"] = [[$16021359]] -- - Effective against Infantry, Commanders and Daemons.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_10"] = [[$16022510]] -- - Limit of TWO (2) Apothecaries per Paladin squad.
GameData["ui_ext"]["ui_info"]["icon_name"] = [[inquisition_icons/grey_knight_apothecary]]
GameData["ui_ext"]["ui_info"]["screen_name_id"] = [[$16021350]] -- Terminator Apothecary
